(69862, 122170, 6356, 1, '攏勿會歹勢', '', '1999-02-19 00:00:00', 2000, 20, 0, 1, '逐工有人底冤家　這是今嘛的社會　逐工有人底怨嗟　生活總是嘛愛過\n你講莫法度改變　只有惦墊底咧做　賺到大錢離開這片土地　你甘攏勿會歹勢\n攏勿會歹勢　勿會歹勢　攏勿會歹勢　勿會歹勢　攏勿會歹勢　勿會歹勢\n攏勿會歹勢　勿會歹勢\n\n天頂無鳥仔底咧飛　流浪的狗仔嘛真濟　檳榔吐甲奚落落　垃圾丟甲滿四界\n你講莫法度控制　逐家攏嘛安呢做　管它環保是啥貨　日子也勿會卡好過\n攏勿會歹勢　勿會歹勢　攏勿會歹勢　勿會歹勢　攏勿會歹勢　勿會歹勢\n攏勿會歹勢　勿會歹勢\n\n警察攏嘛底污西　軍中的米蟲有夠濟　揀到代表就吃百歲　一票巧濟嘛乎落\n官商攏嘛底交陪　管它人民要啥貨　這是啥咪底社會　這是啥咪的政府\n\n攏勿會歹勢　勿會歹勢　國民黨你攏勿會歹勢　勿會歹勢\n攏勿會歹勢　勿會歹勢　攏勿會歹勢　勿會歹勢', '', 273, '董事長樂團', '吳永吉', '吳永吉', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 17:10:39', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
(69863, 122170, 6356, 2, '軋車', '', '1999-02-19 00:00:00', 2000, 20, 0, 1, '是按怎阿花和阿嬌　攏無佳意我　我撇車技術一流　無人和我軋\n是按怎學校的老師　攏無疼痛我　是不是ABCD看無　卡憨就攏免教\n老爸老母歸工底罵　喋喋喋唸無知唸啥\n是按怎哪會按呢　身邊的問題一攤\n這時陣上好作陣來去軋車\n作陣來軋車　作陣來軋車　毋管伊警察底抓　毋管伊父母底罵\n只要我引擎催落　無人可當甲我軋　在這我最快　最ㄆㄚ　最大\n是按怎今日觀眾攏底打拍仔\n逐家看我一個親像Super Star　 La La La\nLa La La La La La La　愈騎愈快愈爽我想欲唱歌\n頭腦底飛　身軀底顫　風底吹我　心底流汗\n是按怎那會這爽　要瞭解我的感覺　這時陣上好作陣來去軋車', '', 163, '五月天', '阿信', '阿信', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 17:10:58', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
(69864, 122170, 6356, 3, '活著', '', '1999-02-19 00:00:00', 2000, 20, 0, 1, '今天我感到頭昏腦脹　不知不覺頭皮又發麻\n報紙上都是無聊的笑話　看來看去真是令人不爽\n因為　腐敗的世界　我們不知憤怒往哪兒塞\n聽到　地球的哭泣　隨著哭聲在大雨中跳吧\n\n生活充滿了鋼筋水泥　容不下一點點的綠\n麻煩活在我們的呼吸　他說生命是件賠本的生意\n因為　奢侈的眼睛　看到都是自己的名字\n新鮮　藏不住空虛　趕快找回失去的氧氣\n\n偉大什麼我不怕　爭奪什麼我不想看\n太長的路　活著必須要承擔\n聽夠阿諛諂媚的空洞　受慣榮華富貴的皇冠\n有天隨著夢飛了　就把自私全部吐出來\n\n今天就和昨天一樣　沒有高潮沒有任何緊張\n忽然一生轟天巨響　放個屁好比茉莉花香\n因為　非常無聊　無聊到自殺都想要想辦法\n嘴巴　吐不出象牙　只好把垃圾全部吃光\n\n就把自私全部吐出來　就把自私全部吐出來\n吐出來　吐出來　吐出來　吐出來', '', 270, '四分衛', '陳如山', '陳如山', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 17:11:23', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
(69865, 122170, 6356, 4, '台灣性高潮', '', '1999-02-19 00:00:00', 2000, 20, 0, 1, '親愛的李伯伯　請你不要害臊　你的眼神彷彿在說你心在燃燒\n記得吃藥　可小心別中標　不要躲在人家懷裡邊哭邊撒嬌\n親愛的江叔叔　請你別再嘮叨　注意你的心跳可小心別摔跤\n抱著老娘　你回家睡個好覺　不要對我們毛手毛腳不要亂放炮\n親愛的父老　請別再耍大條　你的臉孔越來越像花花綠綠的鈔票\n別太驕傲　那樣很俗套　小心如此風騷被人桶了一刀\n親愛的同志　中國的同胞　好想同你擁抱聞那祖國的騷包\n別開玩笑　請別再倚老賣老　只怕你們一來我們就吃不飽\n親愛的人民　台灣的同胞　人生好像還有事情比吃飯更重要\n快舉起雙手　一起來呼口號　我們不要武力騷擾我們要性高潮', '', 244, '張四十三', '張四十三', '張四十三', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 17:11:44', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
(69866, 122170, 6356, 5, '黑水溝之歌', '', '1999-02-19 00:00:00', 2000, 20, 0, 1, '揀一個風雨的暝來出航　艱苦勿免講予人聽\n氣候自古就多變化　歹天勿是麥歹乎人驚\n雖然一時來受風寒　無等天光麥那會知輸贏\n咱來討海　海討命　無好大膽麥那有好名聲\n\n揀一個風雨的天來起行　雷聲響遍歸山坪\n親戚五十愛阮慢且息　逐家相招要來作陣行\n雖然時來受風寒　無等天光麥那會知輸贏\n咱來討海　海討命　無好大膽麥那有好名聲\n\n雖然一時來受風寒　無等天光麥那會知輸贏\n代先驚死的代先無性命　作先鋒　聽咱的歌聲', '', 194, '阿福', '阿福', '阿福', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 17:12:00', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
(69867, 122170, 6356, 6, '給我一槍', '', '1999-02-19 00:00:00', 2000, 20, 0, 1, '那天你遮住我雙眼　我　突然失去了方向\n你說你要牽我的手帶我到天堂　可是我卻感覺路上越來越黑暗\n昨夜悄悄睜開雙眼　卻看你拿著槍對著我胸膛\n請給我一槍　讓我有溫暖　忘了你模樣　不再有想像', '', 300, '全方位樂團', '蕭煌奇', '張四十三', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 17:12:28', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
(69868, 122170, 6356, 7, '脫殼歌', '', '1999-02-19 00:00:00', 2000, 20, 0, 1, 'Give me a suffer\nGive me a bitter\n工程灌水早就已經不稀奇　市價一成　阿廣仔告訴你\n張三終結縣長很得意　魔鬼阿諾請不要懷疑\n本尊身份隨便就有好幾十億　想要出家　到中台山去\n黑槍棒球兩大聯盟金錢遊戲　高爾夫球場是台灣的競爭力\n都市叢林小姐千萬不能大意　撘錯車　你就來不及\n縱火殺人新聞每天如此詭異　終極警探你到底在哪裡\n想要忘記　用力忘記　想要忘記　給它忘記', '', 242, '魔鏡', '林恆立', '林恆立/陳昌棟', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 17:12:49', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
(69869, 122170, 6356, 8, '爬到屋頂去哭妖', '', '1999-02-19 00:00:00', 2000, 20, 0, 1, '總是想要找個''公主''泡一泡　但是又怕''鼠蠟''乎我''貓一貓''\n真的不知道什麼叫做''做人之道''　只有爬到屋頂去放鞭炮\n昨天看到有人拿隻開山刀　今天有個小孩需要找一找\n所以這個地方真是亂七八糟　只好爬到屋頂去哭妖\n安靜之中覺得混亂的需要　混亂之中總是感到安靜的重要\n所以活著真得需要調一調　最好爬到屋頂去哭妖', '', 183, '夾子', '應蔚民', '應蔚民', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 17:13:07', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
(69870, 122170, 6356, 9, 'RESCUE ME', '', '1999-02-19 00:00:00', 2000, 20, 0, 1, '風和日麗　清新的空氣　有你的照顧　過不下去\n白色的陽光　黑色的心情　有你的照顧　更要小心\n漸漸的想起　昨天的情形　有你的照顧　已沒有情緒　如果能夠活得上進\n如果可以一切都不可以　如果真的要活得上進　我不要一切都不可以\n我只想躺在那綠草地　每天每天都不用擔心\n不管日子怎麼過去　童年也應該是無憂無慮　喔......\n如果可以　睡得放心　如果可以　早點清醒\nSo Can You Rescue Me', '', 168, '花生隊長', '花生隊長', '花生隊長', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 17:13:30', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
(69871, 122170, 6356, 10, '山上的孩子', '', '1999-02-19 00:00:00', 2000, 20, 0, 1, '山上的孩子　奔馳在土地上　天真的臉龐是多麼可愛\n山上的孩子　嬉戲在河水中　燦爛的笑容是一陣傳來\n睜開雙眼　抬起胸懷　張開雙手　歌聲澎湃\nQi Ta Sea Senai Lu Qi a Lu Mi\nQi Ta Sea Senai Lu Qi a Lu Mi\n山上的孩子　你們要明白　傳統的智慧　要學習忍耐\n山上的孩子　你們要明白　現代的世界　要信心滿懷\n勇敢向前　腳步邁開　一起高歌　美麗節拍\nQi Ta Sea Senai Lu Qi a Lu Mi\nQi Ta Sea Senai Lu Qi a Lu Mi\n\n註:特別感謝　羅馬音拼寫/台東南王村.曾修花女士', '', 307, '原音社', '原音社', '原音社', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 17:15:25', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
