(69874, 122170, 6357, 3, '窺 ', '', '2001-10-26 00:00:00', 2001, 20, 0, 1, '我看著你的表情就快成雨季 \n拿出了紙和鉛筆也無法算計 \n把太陽一口吹熄找不到邏輯 \n反正這世界本來就沒道理 \n\n你皺紋讓我質疑像預報天氣 \n在你指縫間我繼續遊戲 \n忍不住超速看不太清晰 \n我放棄謙虛無所謂收集 \n\n也許我臉孔全都荒廢 猜忌你想起忘記誰 \n可能廉價的沒有滋味 欺騙了誰與你相隨 \n(不介意再設下一回 輕易就剝離了安慰) \n\n你皺紋讓我質疑像預報天氣 \n在你指縫間我繼續遊戲 \n忍不住超速看不太清晰 \n我放棄謙虛無所謂收集 \n\n也許我臉孔全都荒廢 猜忌你想起忘記誰 \n可能廉價的沒有滋味 欺騙了誰與你相隨 \n\n放一顆星球 在你的眉頭 \n等你開口 再長出宇宙 \n要我伸出手 在你的背後 \n讓你揮霍 哪一隻脆弱 \n\n放一顆星球 在你的眉頭 \n等你開口 再長出宇宙 \n要我伸出手 在你的背後 \n讓你揮霍 哪一隻脆弱 \n\n也許我臉孔全都荒廢 猜忌你想起忘記誰 \n可能廉價的沒有滋味 欺騙了誰與你相隨 \n(不介意再設下一回 輕易就剝離了安慰) \n\n你皺紋讓我質疑像預報天氣 \n在你指縫間我繼續遊戲 \n忍不住超速看不太清晰 \n我放棄謙虛無所謂收集 ', '', 258, '蘇打綠', '青峰', '青峰', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 17:54:59', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
