(69876, 122170, 6357, 5, '存在 ', '', '2001-10-26 00:00:00', 2001, 20, 0, 1, '我會存在這個空間 是我知道下一秒你會出現\n\n穿梭在人群之間 你的身影永遠忽隱忽現\n\n是不是我無力去挽回\n\n是不是你忘了我的美\n\n是不是我的存在你覺得可憐\n\n到不到底問題沒有解決\n\n到不到底希望不在身邊\n\n到不到底我存在 是錯是對\n\n存在你的世界是否需要另外一種語言\n\n我永遠不懂你的想法\n\n你所需要的那種心願\n\n是不是我無力去挽回\n\n是不是你忘了我的美\n\n是不是我的存在你覺得可憐\n\n到不到底問題沒有解決\n\n到不到底希望不在身邊\n\n到不到底我存在 是錯是對\n\n是不是我無力去挽回\n\n是不是你忘了我的美\n\n是不是我存在你覺得可憐\n\n到不到底問題沒有解決\n\n到不到底希望不在身邊\n\n到不到底我存在 是錯是對', '', 255, '強辯', '黃牛', '黃牛', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 17:55:50', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
