(69879, 122170, 6357, 8, '繞 ', '', '2001-10-26 00:00:00', 2001, 20, 0, 1, '', '請求你 淹沒我 淹沒我的眼耳鼻口\n捉摸我 摸不透\n何不請你 吃了我\n何不請你 啃了我\n別作弄我 就算我曾留連卻步\n請求你 吞沒我 連同剩餘的殘缺面容\n觸摸我 是否可口\n何不請你 吃了我\n何不請你 啃了我\n何不請你 吞了我 我已不能夠再等待\n我將離開\n\n我在你眼中 是個錯 我也不願再追究\n臉依舊蒼白 是個夢 我也不願再多說\n心無止盡地繞 懸念著 你的頹廢\n街無止盡的繞 盤懸著 不曾熄滅的火\n人無止盡的繞 彌補著 一絲眷戀 難以挽救的傷痕\n夜無止盡的繞 訴說著 美麗沉淪\n你不置可否\n也許是該無奈\n繞著你 轉啊轉', 287, 'Echo', '', '', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 18:16:01', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
(69880, 122170, 6357, 9, '有風的雨季 ', '', '2001-10-26 00:00:00', 2001, 20, 0, 1, '三月三日下大雨 我掛在網上寫日記\n他說HI~ 我想要認識你 SO我們通信暪著你\n三月十一天氣晴 我和他約在西門町\n他說嘿！我喜歡你的眼睛\n我做了一個困難的決定\n\n我們都需要好好整理這一段感情\n離開我的你也應該要快樂下去\n\n有風的雨季 不許你傷心\n我們都一直還是知己 可以一起看電影\n\n有風的雨季 不許你傷心\n我不會忘記美麗的曾經\n\n\n三月三日下大雨 我掛在網上寫日記\n他說HI~ 我想要認識你 SO我們通信暪著你\n三月十一天氣晴 我和他約在西門町\n他說嘿！我喜歡你的眼睛\n我做了一個困難的決定\n\n我們都需要好好整理這一段感情\n離開我的你也應該要快樂下去\n\n有風的雨季 不許你傷心\n我們都一直還是知己 可以一起看電影\n\n有風的雨季 不許你傷心\n我不會忘記美麗的曾經\n\n有風的雨季 不許你傷心\n我們都一直還是知己 可以一起看電影\n\n有風的雨季 不許你傷心\n我不會忘記美麗的我 美麗的曾經\n那千言萬語 讓它隨風去', '', 233, '雪莉樂', '', '', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 18:17:56', '2015-03-12 14:03:53', '0000-00-00 00:00:00'),
