(69883, 32550, 0, 1, 'save or sell me(demo)', '', '2013-12-19 00:00:00', 2000, 19, 1, 7, '忽然想起那一天 還有眼淚\n忽然想起那時候 單純可愛\n\n你沒有變 是我變了\n你沒有變 世界變了\n我還在習慣\n這失控的一切\n\nwont you save me till the end\nor sell me till the end\n\n你說 你夢 眷戀 佔有\n我說 我夢 我不 停留\n\n你沒有變 世界變了\n你沒有變 是我變了\n我還在習慣\n這失控的一切', '', 230, '', '', '', '', '梨可辰', '', 0, 1, 1, '2013-12-19 18:44:07', '2014-04-20 13:08:49', '2014-04-20 13:08:49'),
(69884, 122170, 6357, 12, '小綿羊趕集 ', '', '2001-10-26 00:00:00', 2001, 20, 0, 1, '咩～～～\n時間現在非常早 早的不得了\n主人起床看看手上的手錶\n主人對我微微笑 心情非常好\n餵我吃吃草 早餐吃的非常飽\n我也開心的大叫 咩～～～\n\n我好像看到剪刀 在我面前飄\n我身上的毛都生氣的不得了\n一跟一跟往下掉 全部都死掉 然後變成\nMany Money.... 咩～～～\n\n一直一直叫....\n一直一直掉....\n變成毛線帽\n不要....\n不要....\n不要剪掉....\n\n＊ ＊ ＊ 吉他ｓｏｌｏ ＊ ＊ ＊\n\n跳蚤在身上奔跑 一直一直跳\n全身上下開始癢的不得了\n綿羊也會有煩惱 也會得感冒\n要報復全世界 把白紙通通都吃掉\n一輩子再也不要洗澡\n\n綿羊根本不乖巧 壞的不得了\n有一天晚上全部都消失掉\n吃掉股票跟支票 所有的鈔票 讓你沒有\nMamy Money.... 咩～～～\n\n咩～～～', '', 164, '旺福', '', '', '', '武藝音樂', '', 1, 1, 0, '2013-12-19 18:55:51', '2015-03-12 14:03:54', '0000-00-00 00:00:00'),
