(69886, 15974, 3396, 6, '淚花', '人生當中曾經有那麼一個好友，\n一起瘋狂一起追夢，\n在失落時給我鼓勵，在沮喪時教我勇敢，\n教我要樂觀面對一切。\n如果有一天，這個很棒的朋友就這樣突然離開了，\n說好要一起實現的夢想，一起完成的事，全都無法再實現，\n在兩人最常去的地方，懷念起這些回憶時，\n眼淚就會不自覺的落下，\n輕輕的隨風而飛。', '2013-11-30 00:00:00', 2000, 20, 0, 5, '老朋友 不知影 你現在 過的好嗎\n是不是仍然 會去海邊看風吹\n好朋友 不知影 你現在 會在哪裡\n是不是還會 懷念昨日咱說過的話\n\n老朋友 不知影 眼淚 怎會隨風飛\n就好像那天 看到隨你離開的花 \n好朋友 不知影 為什麼 我期待的一切\n哪會到今日 隴總都無地找\n\n惦這個世界 有很多無奈\n是你教給我 要勇敢來對待\n不管多少困難 多少失敗 都要\n但是這個信念 漸漸崩壞\n人生有多少 失望和悲哀\n如今剩我一人 你叫我如何 勇敢\n\n惦這個世界 有很多無奈\n是你教給我 要勇敢來對待\n不管多少困難 多少失敗 都要\n但是這個信念 漸漸崩壞\n人生有多少 失望和悲哀\n如今剩我一人 你叫我如何 作美夢\n\n好朋友 不知影 你現在 會在哪裡\n你剛會知影 我在這裡思念你 ', '', 311, '', '徐喜得', '徐喜得', '徐喜得', 'Random80% - 徐喜得', '', 0, 1, 0, '2013-12-20 09:27:34', '2015-03-12 14:03:54', '0000-00-00 00:00:00'),
